import { BrowserRouter, Routes, Route } from "react-router-dom";
import Layout from "./layout/Layout";  // Correct import
import SignIn from "./account_pages/SignIn";  // Correct import
import SignUp from "./account_pages/SignUp";  // Correct import
import AuthProvider from "./AuthContext";  // Correct import
import "./App.css";

function App() {
  return (
    <div className="App">
      <AuthProvider>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Layout />}>
              <Route path="/signin" element={<SignIn />} />
              <Route path="/signup" element={<SignUp />} />
            </Route>
          </Routes>
        </BrowserRouter>
      </AuthProvider>
    </div>
  );
}

export default App;
